import Header from '../components/Header';

export default function About() {
  return (
  	<div 
  	  style={{ 
  	    margin: "auto auto", 
  	    width: "1100px", 
  	    textAlign: "center", 
  	    //border: "2px solid green", 
  	    background: "#daf6db",
  	    border: "groove",
  	  }}>
	  <div>
	    <Header />
		  <h1>Featured Video</h1>
		  <iframe width="700" height="400"
		    src="https://www.youtube.com/embed/LzskqGzoLDA">
		  </iframe>
	  </div>
	  <style jsx>{`
        h1,
        h2,
        a,
        p {
          font-family: "Arial";
          textAlign: center;
          color: #125213;
        }
      `}</style>
    </div>
  );
}
